import React from "react";
import CustomButton from "../CustomButton";

const Login = ({ isSignup = false }) => {
    return <div>{isSignup ? <div>hello</div> :
        <div className="flex flex-col items-center bg-white mx-[25%]">
            <span>Login</span>
            <div className="flex flex-col gap-5 my-5">
                <input
                    type="text"
                    placeholder="Full Name"
                    onChange={() => { }}
                    className=" px-3 text-black py-4 border border-gray-300 focus:outline-1 focus:outline-indigo"
                />
                <input
                    type="email"
                    placeholder="Email Address"
                    onChange={() => { }}
                    className=" px-3 text-black py-4 border border-gray-300 focus:outline-1 focus:outline-indigo"
                />
                <input
                    type="text"
                    placeholder="Subject"
                    onChange={() => { }}
                    className=" px-3 text-black py-4 border border-gray-300 focus:outline-1 focus:outline-indigo"
                />
                <input
                    type="text"
                    placeholder="Your Message"
                    onChange={() => { }}
                    className=" px-3 text-black py-4 border border-gray-300 focus:outline-1 focus:outline-indigo"
                />
            </div>
            <div className="mt-5">
                <CustomButton title='Send Message' backgroundColor='bg-indigo' textColor='text-white'
                    borderClass={`border-indigo`}
                />
            </div>
        </div>
    }
    </div>;
};

Login.prototype = {
    isSignup: Boolean,
};

export default Login;
